    var draw = function() {
      // Clear first
      document.querySelectorAll("#canvases")[0].innerHTML = "";

      var mapData = window.jsondata;
      var cellIds = Object.keys(mapData);

      for (var i = 1; i < cellIds.length; i++) {
        var cell = mapData[Number(cellIds[i])],
          x = cell.placement.position.x + 75,
          y = -cell.placement.position.y + 35,
          z = cell.placement.position.z;

        ensureCanvas(z);
        var ctx = findCanvas(z).getContext('2d');

        drawTile(ctx, x, y, z);
      }
    }

    var drawTile = function(ctx, x, y, z) {
      // TODO: Factor out
      const tile = document.getElementById('tile');

      tile.addEventListener('load', e => {
        ctx.drawImage(tile, x, y, 10, 10);
      });
    }

    var ensureCanvas = function(z) {
      console.log("ensureCanvas", z);
      var canvasEl = findCanvas(z);

      if (!canvasEl) {
        var canvasWrapper = document.createElement("div");
        canvasWrapper.classList.add("canvas-wrapper");

        var zLabel = document.createElement("div");
        zLabel.classList.add("zlabel");
        zLabel.innerHTML = "Z: " + z;
        canvasWrapper.appendChild(zLabel);

        var newCanvas = document.createElement("canvas");
        newCanvas.width = 300;
        newCanvas.height = 300;
        newCanvas.dataset.z = z;

        canvasWrapper.appendChild(newCanvas);
        document.querySelectorAll("#canvases")[0].appendChild(canvasWrapper);

        return(findCanvas(z));
      }

      return(canvasEl);
    }

    var findCanvas = function(z) {
      console.log("findCanvas", z);

      var canvasEls = document.querySelectorAll("canvas");

      for (var i = 0; i < canvasEls.length; i++) {
        var canvasEl = canvasEls[i];

        if (canvasEl.dataset.z && canvasEl.dataset.z === z.toString()) {
          return(canvasEl);
        }
      }

      return;
    }
